  int get count => _count;

  List<Links> get links => _links;

  Orders(
      {List<Branditems> ordersitems,
      bool hasMore,
      int limit,
      int offset,
      int count,
      List<Links> links}) {
    _ordersitems = ordersitems;
    _hasMore = hasMore;
    _limit = limit;
    _offset = offset;
    _count = count;
    _links = links;
  }

  Orders.fromJson(dynamic json) {
    if (json["Ordersitems"] != null) {
      _ordersitems = [];
      json["Ordersitems"].forEach((v) {
        _ordersitems.add(Branditems.fromJson(v));
      });
    }
    _hasMore = json["hasMore"];
    _limit = json["limit"];
    _offset = json["offset"];
    _count = json["count"];
    if (json["links"] != null) {
      _links = [];
      json["links"].forEach((v) {
        _links.add(Links.fromJson(v));
      });
    }
  }

  Map<String, dynamic> toJson() {
    var map = <String, dynamic>{};
    if (_ordersitems != null) {
      map["Ordersitems"] = _ordersitems.map((v) => v.toJson()).toList();
    }
    map["hasMore"] = _hasMore;
    map["limit"] = _limit;
    map["offset"] = _offset;
    map["count"] = _count;
    if (_links != null) {
      map["links"] = _links.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

