        baseBrand: json["base_brand"],
      );

  Map<String, dynamic> toJson() => {
        "base_brand": baseBrand,
      };

  static List<Branditems> fromJsonList(List list) {
    return list.map((item) => Branditems.fromJson(item)).toList();
